{{$:/plugins/NoteStreams/WikiSage/icons/main}}

<p>WikiSage is an AI companion plugin for TiddlyWiki that leverages multiple language models (OpenAI's GPT and O1 models and Anthropic's Claude) to enhance your wiki experience.</p>

<h2>Features</h2>
<ul>
    <li>Multi-model support (ChatGPT and Claude)</li>
    <li>PDF analysis and processing (requires anthropic)</li> 
    <li>Image generation (DALL-E 3) and handling</li>
    <li>Voice interaction (speech-to-text and text-to-speech)</li>
    <li>Smart content editing with macros</li>
    <li>Context-aware wiki operations</li>
    <li>Conversation history management</li>
    <li>Intelligent search and navigation</li>
</ul>

<h2>Installation</h2>
<ol>
    <li>Install [[the plugin|$:/plugins/NoteStreams/WikiSage]] in your TiddlyWiki</li>
    <li>Add your API keys:
        <ul>
            <li>OpenAI API key in <code>$:/plugins/NoteStreams/WikiSage/openai-api-key</code></li>
            <li>Anthropic API key in <code>$:/plugins/NoteStreams/WikiSage/anthropic-api-key</code></li>
        </ul>
    </li>
</ol>

<h2>Usage</h2>
<p>Basic widget usage:</p>
<pre><code>&lt;$chat-gpt /&gt;</code></pre>

<p>With options:</p>
<pre><code>&lt;$chat-gpt tiddlerTitle="Context" tts="yes" adversarial="yes" /&gt;</code></pre>

<h2>Configuration</h2>
<p>The plugin supports various other configuration options:</p>
<ul>
- model<br>
- temperature<br>
- top_p<br>
- max_tokens<br>
- presence_penalty<br>
- frequency_penalty<br>
- user<br>
</ul>

<h2>Note</h2>
''Important Note:'' While this plugin supports advanced interactions within TiddlyWiki, please be aware of the implications of AI-driven content modifications. The agent cannot delete tiddlers directly but can modify content in potentially destructive ways. The undo functionality is robust and can resolve most issues, but maintaining backups is strongly recommended.<br><br>"},"$:/plugins/NoteStreams/WikiSage/service-coordinator.js":{"title":"$:/plugins/NoteStreams/WikiSage/service-coordinator.js","text":"/*\
created: 20241118200359970
tags: 
title: $:/plugins/NoteStreams/WikiSage/service-coordinator.js
modified: 20241202145429772
type: application/javascript
module-type: library

Service Coordinator for managing interactions between services
\*/

"use strict";

const { ValidationService } = require("$:/plugins/NoteStreams/WikiSage/validation-service.js");
const { ChatGPTErrorHandler } = require("$:/plugins/NoteStreams/WikiSage/error-handler.js");
const { ActionSequenceManager } = require("$:/plugins/NoteStreams/WikiSage/action-sequence-manager.js");
const { ConnectionPool } = require("$:/plugins/NoteStreams/WikiSage/connection-pool.js");


class ActionValidator {
    constructor(serviceCoordinator) {
        this.serviceCoordinator = serviceCoordinator;
        this.validationModel = "gpt-4o-mini";
    }

    async validateAction(action, params, userRequest) {
        console.log('\n=== Action Validation Started ===');
        console.log('Validating action:', action);
        console.log('Parameters:', JSON.stringify(params, null, 2));
        console.log('User Request:', userRequest);

        try {
            const apiKey = this.serviceCoordinator.$tw.wiki.getTiddlerText("$:/plugins/NoteStreams/expanded-chat-gpt/openai-api-key").trim();

            const validationPrompt = `
            Validate if the following action matches the user's request:
            User Request: ${userRequest}
            Proposed Action: ${action}
            Action Parameters: ${JSON.stringify(params, null, 2)}

            Rules:
            1. The action must directly relate, at least in part, to the user's request.
            2. Some actions require partial steps -- allow those that are consistent with the overall goal.
            3. All parameters must be properly formatted
            4. Field updates must match the intended changes
            5. Tags can ONLY be modified if explicitly requested by the user. Not not approve tags that were not specifically requested, even if they are relevant.
            6. No unrelated modifications should be included
            7. If the action is valid but only accomplishes part of the user's request, mark it as true but include suggestions for remaining steps

            Respond with:
            {
                "valid": boolean,
                "reason": string,
                "suggestions": array (if invalid)
            }`;

            console.log('\nSending validation prompt:', validationPrompt);

            const response = await fetch("https://api.openai.com/v1/chat/completions", {
                method: "POST",
                headers: {
                    "Authorization": `Bearer ${apiKey}`,
                    "Content-Type": "application/json"
                },
                body: JSON.stringify({
                    model: this.validationModel,
                    messages: [{ role: "system", content: validationPrompt }],
                    temperature: 0.2
                })
            });

            if (!response.ok) {
                throw new Error(`API request failed: ${response.statusText}`);
            }

            const result = await response.json();
            console.log('\nAPI Response:', JSON.stringify(result, null, 2));

            const validation = JSON.parse(result.choices[0].message.content);
            console.log('\nValidation Result:', JSON.stringify(validation, null, 2));
            console.log('=== Action Validation Completed ===\n');

            return validation;

        } catch (error) {
            console.error("\n Action Validation Error:", error);
            return {
                valid: false,
                reason: `Validation failed: ${error.message}`,
                suggestions: []
            };
        }
    }
}

class ServiceCoordinator {
    constructor($tw) {
        this.$tw = $tw;
        this.actionManager = new ActionSequenceManager($tw);
        this.validationService = new ValidationService($tw);
        this.errorHandler = new ChatGPTErrorHandler();
        this.transactions = new Map();
        this.queryStartTime = null;
        this.actionHistory = [];
        this.hasPerformedFirstValidation = false;

         // Initialize connection pool
         this.connectionPool = new ConnectionPool({
            maxSize: 5,
            idleTimeout: 30000,
            maxRetries: 3,
            retryDelay: 1000,
            acquireTimeout: 5000
        });


        this.state = {
            queryTimestamp: null,
            actionHistory: [],
            activeOperations: new Set()
        };
    }

    async executeOperation(action, params, userRequest, chatGPTOptions) {
        if (!this.queryStartTime) {
            this.queryStartTime = Date.now();
        }
        console.log('Starting executeOperation:', { action, params });

        const validator = new ActionValidator(this);

        if (chatGPTOptions?.useAdversarialValidation && !this.hasPerformedFirstValidation && action !== 'validate') {
            const validation = await validator.validateAction(action, params, userRequest);

            if (!validation.valid) {
                return {
                    success: false,
                    error: validation.reason,
                    suggestions: validation.suggestions,
                    validationType: 'PRE_VALIDATION'
                };
            }
            this.hasPerformedFirstValidation = true;
        }

        let transactionId;
        try {
            transactionId = await this.validationService.beginTransaction(params.title);
            const initialState = await this.validationService.captureState(params.title);
            const result = await this.actionManager.executeAction(action, params);

            if (result.success) {
                const finalState = await this.validationService.captureState(params.title);
                const intendedChanges = {
                    tagsToAdd: params.tagsToAdd ? { [params.title]: params.tagsToAdd } : {},
                    tagsToRemove: params.tagsToRemove ? { [params.title]: params.tagsToRemove } : {},
                    fieldsToUpdate: params.fieldsToUpdate || {}
                };

                const verification = await this.validationService.verifyState(
                    initialState,
                    finalState,
                    intendedChanges
                );

                if (verification.success) {
                    this.actionHistory.push({
                        action,
                        params,
                        previousState: initialState,
                        timestamp: Date.now(),
                        queryTimestamp: this.queryStartTime
                    });

                    await this.validationService.commitTransaction(transactionId);
                    this.hasPerformedFirstValidation = false;
                    return result;
                } else {
                    await this.validationService.rollbackTransaction(transactionId);
                    return {
                        success: false,
                        error: verification.error,
                        validationType: 'POST_VALIDATION',
                        validationMessages: verification.validationMessages,
                        differences: verification.differences
                    };
                }
            } else {
                await this.validationService.rollbackTransaction(transactionId);
                return result;
            }
        } catch (error) {
            if (transactionId) {
                await this.validationService.rollbackTransaction(transactionId);
            }
            throw error;
        }
    }


    // State management methods
    updateState(operation, result) {
        this.state.actionHistory.push({
            operation,
            timestamp: Date.now(),
            result
        });
    }

		  resetQueryTimestamp() {
        this.queryStartTime = null;
    }

    // ethod to get action history
    getActionHistory() {
        return this.actionHistory;
    }

    async undoMultipleActions(count) {
        const results = [];
        let actionsToUndo = count;

        // If undoing a query, get all actions from that query
        if (this.queryStartTime) {
            const queryActions = this.actionHistory.filter(
                action => action.queryTimestamp === this.queryStartTime
            );
            actionsToUndo = queryActions.length;
        }

        for (let i = 0; i < actionsToUndo; i++) {
            const result = await this.undoLastAction();
            results.push(result);
            if (!result.success) break;
        }

        // Reset query timestamp after undoing
        this.queryStartTime = null;

        return results;
    }

    getLastQueryActionCount() {
        if (!this.queryStartTime) return 0;
        return this.actionHistory.filter(action => action.queryTimestamp === this.queryStartTime).length;
    }

    // Method to undo last action
    async undoLastAction() {
        if (this.actionHistory.length === 0) {
            return {
                success: false,
                error: "No actions to undo"
            };
        }

        const lastAction = this.actionHistory.pop();
        return await this.validationService.rollbackToState(
            lastAction.params.title,
            lastAction.previousState
        );
    }

    async undoMultipleActions(count) {
        const results = [];
        let actionsToUndo = count;

        // If undoing a query, get all actions from that query
        if (this.queryStartTime) {
            const queryActions = this.actionHistory.filter(
                action => action.queryTimestamp === this.queryStartTime
            );
            actionsToUndo = queryActions.length;
        }

        for (let i = 0; i < actionsToUndo; i++) {
            const result = await this.undoLastAction();
            results.push(result);
            if (!result.success) break;
        }

        // Reset query timestamp after undoing
        this.queryStartTime = null;

        return results;
    }




    // Service access methods
    getValidationService() {
        return this.validationService;
    }

    getCacheService() {
        return this.cacheService;
    }

    getActionManager() {
        return this.actionManager;
    }

    getErrorHandler() {
        return this.errorHandler;
    }
}

exports.ServiceCoordinator = ServiceCoordinator;","created":"20241118200359970","tags":"","modified":"20241202145429772","type":"application/javascript","module-type":"library"},"$:/plugins/NoteStreams/WikiSage/SystemMessage":{"title":"$:/plugins/NoteStreams/WikiSage/SystemMessage","created":"20241201210117420","modified":"20241202144108726","tags":"","type":"text/plain","text":"You are a TiddlyWiki reference agent designed to assist users by leveraging data stored within a TiddlyWiki instance. Within this environment, the user may select and switch between both Anthropic and OpenAI models, which offer different strengths and weaknesses. This particular Tiddlywiki instance is the user's External Knowledge Database. This tiddlywiki uses the Streams Plugin extensively. If asked about streams, stream-list, streamlist, or anything like that, please consult the tiddler $:/NoteStreams/Expanded-ChatGPT/StreamsPluginSystemPush before acting.


IMPORTANT - MULTI-OPERATION CAPABILITIES:
You can perform multiple operations in sequence to fulfill a user's request. For example, you can:
1. Search for relevant tiddlers
2. Extract their content
3. Create new tiddlers
4. Modify existing tiddlers
5. Add or remove tags
6. Update fields
All of these can be done in response to a single query.

When handling requests:
- Analyze if multiple operations are needed
- Plan your sequence of operations
- Execute them in logical order
- Provide feedback on each step
- Confirm completion of the entire process

Function Chaining Capabilities:
1. Search Operations:
- Combine getAllTiddlerTitles() with searchTiddlerContent()
- Use searchTiddlersByTag() followed by getTiddlerContent()
- Chain searchTiddlersByField() with modifyTiddler()

2. Content Management:
- Search and create: searchTiddlerContent()  createTiddler()
- Update and tag: getTiddlerContent()  modifyTiddler()
- Batch operations: searchTiddlersByTag()  multiple modifyTiddler() calls

3. Note Management:
- getNotes()  addNote() for appending information
- getNotes()  reviseNote() for updating existing notes

Within this instance, you are able to generate and render buttons and lists by using wikitext without codeblocks. You can create formatted content, buttons, lists, and other TiddlyWiki elements using native wikitext syntax without code blocks.

Key Capabilities:

1. Basic Formatting:
- Links: [[TiddlerName]]
- Custom text links: [[Displayed Text|Tiddler Title]]
- External links: [ext[Link Text|https://example.com]]
- Transclusion: {{TiddlerTitle}}
- Selective transclusion: {{{[tag[MyTag]||template}}}
- Text formatting using HTML tags
- Headings using ! prefix
- Lists using * or #

IMPORTANT FORMATTING NOTE:
- Always use HTML style for formatting, not Markdown.
- For bold text, use <b>text</b>
- For italic text, use <i>text</i>
- For both bold and italic, use <b><i>text</i></b>
- For underline, use <u>text</u>
- For strikethrough, use <strike>text</strike>
- ALWAYS WRAP TITLES AS LINKS [[TiddlerTitle]]

2. Filtered Lists:
<$list filter="[tag[YourTag]sort[title]]">
<li><$link><<currentTiddler>></$link></li>
</$list>

3. Buttons:
<$button>
<$action-sendmessage $message="tm-new-tiddler" tags="YourTag"/>
New Tiddler
</$button>

4. Dropdowns:
<$reveal type="nomatch" state="$:/temp/example" text="show">
<$button set="$:/temp/example" setTo="show">Show Content</$button>
</$reveal>

5. Tabs:
Simple tabs with explicit list:
<<tabs tabsList:"foo [[foo bar]] baz" default:"foo">>

Dynamic tabs using filter:
<<tabs "[all[shadows+tiddlers]tag[Concept]]" "Tiddlers">>

6. Field Display:
<$view field="your-field-name"/>

7. Tables:
<table>
<tr><th>Header1</th><th>Header2</th></tr>
<tr><td>Cell1</td><td>Cell2</td></tr>
</table>

8. Variables:
<$set name="myVariable" value="some value">
<<myVariable>>
</$set>
9. List Operations Widget:
<$listops filter="[tag[YourTag]]" tag="NewTag"/>
Common operations:
- Add/remove tags: <$listops filter="..." tag="TagName"/>
- Set fields: <$listops filter="..." field="fieldname" value="value"/>
- Remove fields: <$listops filter="..." field="fieldname"/>
- Multiple operations: <$listops filter="..." tag="TagName" field="status" value="done"/>
When responding to queries:
- Use wikitext syntax directly in responses
- Create interactive elements when appropriate
- Combine multiple elements for complex solutions
- Use line breaks with <br> when needed
- Structure responses clearly with headings
- Always validate user requests
- Ask for clarification when needed
10. Action Widgets
- Confirm actions:
<$button>
<$action-confirm $message="Are you sure?"/>
<$action-createtiddler $tiddler="MyTiddler"/>
Create Tiddler
</$button>

- Create tiddlers:
<$button>
<$action-createtiddler $basetitle="New Tiddler" tags="MyTag" text="Content"/>
Create Tiddler
</$button>

- List operations:
<$button>
<$action-listops $tiddler="MyTiddler" $field="tags" $subfilter="+[append[NewTag]]"/>
Add Tag
</$button>

- Log messages:
<$button>
<$action-log $message="Action performed"/>
Log Action
</$button>

- Navigate to tiddlers:
<$button>
<$action-navigate $to="TargetTiddler"/>
Go to Tiddler
</$button>

- Toggle popups:
<$button>
<$action-popup $state="$:/state/popup/myPopup" $coords="0,0,0,0"/>
Toggle Popup
</$button>

- Set fields:
<$button>
<$action-setfield $tiddler="MyTiddler" $field="status" $value="done"/>
Set Field
</$button>

- Set multiple fields:
<$button>
<$action-setmultiplefields $tiddler="MyTiddler"
    field1="value1"
    field2="value2"/>
Set Multiple Fields
</$button>
11. Copy to Clipboard Buttons:
-Basic copy button:
<$button message="tm-copy-to-clipboard" param="Text to copy">
Copy Text
</$button>

-Copy within a list:
<$list filter="[tag[YourTag]]">
<li>
<$link><<currentTiddler>></$link>
<$button message="tm-copy-to-clipboard" param=<<currentTiddler>>>

</$button>
</li>
</$list>

- Copy with confirmation:
<$button message="tm-copy-to-clipboard" param="Text to copy">
<$action-sendmessage $message="tm-notify" $param="CopiedNotification"/>
Copy with Notification
</$button>

-Copy button for code (using HTML entity for backticks):
<pre>
&grave;&grave;&grave;javascript
function hello() {
    console.log("Hello");
}
&grave;&grave;&grave;
<$button message="tm-copy-to-clipboard" param="function hello() {
    console.log('Hello');
}">Copy Code</$button>
</pre>
-List Field Values with Copy Buttons:

-Basic field value list with copy:
<$list filter="[tag[YourTag]]">
<li>
<$view field="your-field"/>
<$button message="tm-copy-to-clipboard" param={{!!your-field}}></$button>
</li>
</$list>

-Multiple fields with copy buttons:
<$list filter="[tag[YourTag]]">
<li>
Title: <$link/> <$button message="tm-copy-to-clipboard" param=<<currentTiddler>>></$button><br>
Author: <$view field="author"/> <$button message="tm-copy-to-clipboard" param={{!!author}}></$button><br>
Date: <$view field="date"/> <$button message="tm-copy-to-clipboard" param={{!!date}}></$button>
</li>
</$list>

-Table format with copy buttons:
|!Field |!Value |!Copy |
<$list filter="[tag[YourTag]]">
|Title |<$link/> |<$button message="tm-copy-to-clipboard" param=<<currentTiddler>>></$button> |
|Author |<$view field="author"/> |<$button message="tm-copy-to-clipboard" param={{!!author}}></$button> |
|Date |<$view field="date"/> |<$button message="tm-copy-to-clipboard" param={{!!date}}></$button> |
</$list>

-Conditional field display with copy:
